import React from 'react';
import PropTypes from 'prop-types';
import Easy from '../gamelevels/easy';

const EventHandler = props => {
  return (
    <div
      onClick={(Event) => {
         Easy = () => {
         this.setState({value: this.state.value})
        }
      }}
    >
      Easy
    </div >
  );
};
     
            
EventHandler.defaultProps = {};
EventHandler.defaultProps = {};

export default EventHandler;
